import PropTypes from 'prop-types';
import { useEffect, useState } from 'react';
import StartBot from './StartBot/StartBot';
import CopyTelegramId from './CopyTelegramID/Copy Telegram ID';
import EnterTelegramId from './EnterTelegramID/EnterTelegramID';
import ConnectNotification from './ConnectNotification/ConnectNotification';
import Button from '../../../shared/Button/Button';
import { Link } from 'react-router-dom';
import { ROUTES } from '../../../../config/constants';

const Telegram = props => {
    const [currentPage, setCurrentPage] = useState(0);

    return (
        <div className='h-full flex flex-col'>
            <h1 className='text-2xl text-gray-800 font-medium pb-6 mb-10 border-b border-gray-300'>Telegram</h1>
            <div className='max-w-3xl pr-10 xl:pr-16'>
                <div className='bg-white h-72 p-7 rounded-md shadow flex flex-col justify-between'>
                    <div>
                        <h2 className='mb-7 text-2xl font-medium text-gray-800'>Start Bot</h2>
                        <p className='text-gray-700 text-xl mb-3'>
                            Start our Telegram Bot to receive trade notifications
                        </p>
                        <div className='flex justify-center'>
                            <Button type={'link'}>Open Telegram Bot</Button>
                        </div>
                    </div>

                    <div className='flex justify-center'>
                        <Button type={'primary'} className={'bg-indigo-600 hover:bg-indigo-700'}>
                            Next
                        </Button>
                    </div>
                </div>
            </div>
        </div>
    );
};

Telegram.propTypes = {};

export default Telegram;
